import HeaderPage from './HeaderPage'
import modelyback from './teslaimg/AWD_hero@2.jfif'
const ModelY = () => {
    return (
        <HeaderPage
         title="Model Y"
         background={modelyback}
         description="Speed"
         range="670
         km"
         time="1.99s"
         speed="372
         km/h"
         horsepower="1,320hp"
         first
      />
      
      );
}
 
export default ModelY;
